Приложение «Кофемания Online» – удобный способ заказывать разнообразные и вкусные блюда и напитки из московских ресторанов Кофемания и получать баллы за покупки. 

В приложении вы сможете:
•	быстро заказать блюда, напитки и десерты;
•	оформить предзаказ на кулинарию и специальные позиции;
•	оформить доставку или самовывоз;
•	сделать заказ «с собой» к определенному времени или «как можно скорее»;
•	оплатить заказ банковской картой или через Apple Pay;
•	воспользоваться всеми преимуществами программы лояльности #МОЯКОФЕМАНИЯ;
•	повторить заказ в один клик;
•	посмотреть адреса и контакты ресторанов;
•	выбрать блюда с помощью удобного фильтра или найти блюдо по названию;
•	оставить отзыв и пожелания о нашей работе.

Команда Кофемании постоянно работает над улучшением приложения. Новые функции находятся в разработке и будут доступны в следующих версиях приложения.

Кофемания появилась в столице в 2001 году.

Для многих гостей Кофемания — неотъемлемая часть жизни на протяжении 20 лет. Наши гости ценят чуткий сервис, неизменное качество и вкус блюд, напитков и десертов.

В Кофемании идеально сочетаются тёплая уютная кофейня и ресторан с разнообразной кухней, собранной со всех уголков мира.

Для участников программы лояльности #МОЯКОФЕМАНИЯ действуют дополнительные бонусы:
• При оплате заказа на доставку, а также навынос в ресторанах Москвы и МО через наше мобильное приложение премиальными картами World Mastercard Black Edition® и World Elite Mastercard® дополнительные 15% баллов от суммы покупки.
• При оплате заказа в аэропортах Домодедово и Шереметьево через наше мобильное приложение премиальными картами Visa Platinum, Visa Signature или Visa Infinite дополнительные 15% баллов от суммы покупки
Подробности об этих и других акциях смотрите на сайте coffeemania.ru

Новое мобильное приложение «Шоколадницы» — это единая программа лояльности для всех заведений сети. С его помощью вы сможете без труда найти ближайшее кафе, узнать о действующих акциях и специальных предложениях.

Что дает участие в программе лояльности:

- бонусы за каждый заказ, которыми можно оплачивать следующие покупки (до 50% от суммы чека);
- кэшбек 10%;
- кофе (размера S) в подарок после первой покупки;
- 200 бонусов в подарок за 5 дней до дня рождения;
- «штампики»: каждый 10-й кофе, завтрак, ланч и ужин — бесплатно;
- персональные акции: пуш-уведомления с выгодными предложениями;
- абонементы и подарочные карты, которые можно приобрести в приложении и подарить в электронном виде.

Что получится, если связать воедино лаконичную японскую эстетику, вкусные суши и функциональность?

Теперь YaponaMama еще ближе к вам! Закажите суши, роллы и другие полюбившиеся вам блюда всего за несколько кликов!

- подробное меню с фотографиями и описанием блюд;
- отслеживание статуса;
- online-оплата через Uzcard;
- оплата наличными и банковской картой при доставке и самовывозе;
- выбор блюд по ингредиентам;
- быстрый поиск по блюдам в пределах категории;
- прямой вызов в call-центр одним кликом;
- можно указать адрес с помощью геолокации;
- персональный кабинет, где можно просматривать историю заказов и вносить адреса;
- синхронизация заказов между различными устройствами.

Наше приложение - это диеты на любой вкус! В нем вы найдете самые разнообразные диеты:

 - белковые и углеводные;
 - диеты по группе крови;
 - быстрые и модные диеты;
 - жесткие диеты и легкие;
 - монодиеты и диеты звезд;
 - низкокалорийные диеты;
 - диеты раздельного питания;
 - и многие, многие другие диеты;

Диетические блюда могут быть вкусными, если найти хорошие рецепты. Мы сделали эту работу за вас и собрали рецепты правильного питания и диеты в одном приложении!

Скачайте приложение, питайтесь правильно и с удовольствием. Теперь ваша фигура в полной безопасности.
Все блюда просты в приготовлении, состоят только из полезных ингредиентов и имеют необыкновенный вкус.

Особенности приложения:

 - несколько тысяч разнообразных диет и рецептов;
 - удобный поиск нужного рецепта и диет;
 - возможность создать коллекции любимых рецептов и диет;
 - пошаговая инструкция к каждому рецепту с ингредиентами и калориями;
 - красочные иллюстрации каждого рецепта;
 - возможность поделиться любым рецептом по почте и не только;
 - и многое другое!

Наше приложение поможет Вам выбрать самую эффективную индивидуальную диету. Худейте с удовольствием!

***

Вы можете оформить подписку на месяц или год. И получить доступ ко всем диетам и рецептам, которые есть в нашем приложении. 
Оплата будет списываться с вашей карты за 24 часа до окончания вашей текущей подписки. 
После истечения срока действия ваша подписка будет продлеваться автоматически, но вы всегда сможете отменить автопродление в настройках своего профиля itunes. 

